import React, { useState } from 'react';

function PropertyTab({ onCalculate }) {
  const [propertyValue, setPropertyValue] = useState('');
  const [downPayment, setDownPayment] = useState('');
  const [interestRate, setInterestRate] = useState('');

  const handleCalculate = () => {
    const loanAmount = propertyValue - downPayment;
    const monthlyInterestRate = interestRate / 12 / 100;
    const loanTermYears = 30; // Предполагаемый срок кредита в годах
    const numPayments = loanTermYears * 12;
    const monthlyPayment = (loanAmount * monthlyInterestRate) / (1 - Math.pow(1 + monthlyInterestRate, -numPayments));

    onCalculate(monthlyPayment);
  };

  return (
    <div>
      <h2>Недвижимость</h2>
      <input
        type="number"
        placeholder="Стоимость недвижимости"
        value={propertyValue}
        onChange={(e) => setPropertyValue(e.target.value)}
      />
      <input
        type="number"
        placeholder="Первоначальный взнос"
        value={downPayment}
        onChange={(e) => setDownPayment(e.target.value)}
      />
      <input
        type="number"
        placeholder="Процентная ставка"
        value={interestRate}
        onChange={(e) => setInterestRate(e.target.value)}
      />
      <button onClick={handleCalculate}>Рассчитать</button>
    </div>
  );
}

function CreditTab({ onCalculate }) {
  const [loanAmount, setLoanAmount] = useState('');
  const [loanTerm, setLoanTerm] = useState('');

  const handleCalculate = () => {
    const monthlyInterestRate = 0.05; // Пример процентной ставки
    const numPayments = loanTerm * 12;
    const monthlyPayment = (loanAmount * monthlyInterestRate) / (1 - Math.pow(1 + monthlyInterestRate, -numPayments));

    onCalculate(monthlyPayment);
  };

  return (
    <div>
      <h2>Кредит</h2>
      <input
        type="number"
        placeholder="Сумма кредита"
        value={loanAmount}
        onChange={(e) => setLoanAmount(e.target.value)}
      />
      <input
        type="number"
        placeholder="Срок кредита (в годах)"
        value={loanTerm}
        onChange={(e) => setLoanTerm(e.target.value)}
      />
      <button onClick={handleCalculate}>Рассчитать</button>
    </div>
  );
}

function PaymentTab({ onCalculate }) {
  const [monthlyPayment, setMonthlyPayment] = useState('');

  const handleCalculate = () => {
    const interestRate = 0.05; // Пример процентной ставки
    const loanTermYears = 30; // Предполагаемый срок кредита в годах
    const loanAmount = (monthlyPayment * ((1 - Math.pow(1 + interestRate, -loanTermYears * 12))) / interestRate);

    onCalculate(loanAmount);
  };

  return (
    <div>
      <h2>Платеж</h2>
      <input
        type="number"
        placeholder="Ежемесячный платеж"
        value={monthlyPayment}
        onChange={(e) => setMonthlyPayment(e.target.value)}
      />
      <button onClick={handleCalculate}>Рассчитать</button>
    </div>
  );
}

function MortgageCalculator() {
  const [result, setResult] = useState('');

  const handleCalculate = (result) => {
    setResult(result.toFixed(2)); // Округляем результат до двух знаков после запятой
  };

  return (
    <div>
      <PropertyTab onCalculate={handleCalculate} />
      <CreditTab onCalculate={handleCalculate} />
      <PaymentTab onCalculate={handleCalculate} />
      <div>Результат: {result}</div>
    </div>
  );
}

export default MortgageCalculator;
